        if (hasMilestone("f", 1) || hasMilestone("a",1)) keep.push("milestones")
        if (hasMilestone("f", 3) || hasMilestone("a",1)) keep.push("upgrades")
        if (layers[resettingLayer].row > this.row) layerDataReset(this.layer, keep)
