        let eff = b.add(1).log10().div(30)
        if (eff.gte(1)) eff = eff.pow(0.8).sub(1).mul(3).pow10()
        if (eff.gte(1e6)) eff = eff.log10().div(6).pow(1.5).mul(6).pow10().div(1e6).pow(4).mul(1e6)
        if (eff.gte(1e20)) eff = eff.div(1e20).pow(12).mul(1e20)
